note_models.css:
.card {
  font-family: arial;
  font-size: 20px;
  text-align: center;
  color:black;
  background-color: white;
}

.card .front:before {
  content: "tpi: ";
  color: #888;
}
.card .back:before {
  content: "eng: ";
  color: #888;
}
.card blockquote {
  margin:1em auto;
  text-align: left;
  width: 80%;
  background: #eee;
  border-left: 2px solid #aaa;
  padding: 4px;
}
.card .remarks {
  font-size: 80%;
  color: #559;
}
